import './App.css';
import React, { useEffect } from 'react';
import { Route } from 'react-router-dom';

const App = () => {
  useEffect(()=>{
    fetch('/api/stations/',{
     method:"GET",
     mode: 'no-cors'
    },[])
  .then(res => res.json())
  .then(data => console.log(data))
  .catch(error => console.error(error));
  })

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="journeyTable" element={<JourneyTable />} />    
        <Route path="about" element={<AboutPage />} />
      </Routes>
    </div>
  );
}

export default App;
